⁣
أشادت النجمة السعودية «بريفان» بالتطور الكبير الذي تشهده الدراما الخليجية عامة، والسعودية على وجه الخصوص.⁣
⁣
وتوقعت أن تصبح الدراما السعودية خلال السنوات المقبلة، أهم دراما خليجية، وذلك بسبب التطور الذي حققته في الفترة الأخيرة.⁣
⁣
وتستعد حاليًا بريفان للقيام بأكثر من عمل فني؛ حيث كشفت في تصريحات صحفية لها، أنها سوف تطل على جمهورها بفيلمين من سلسلة أفلام «عناقيد»من إنتاج قناة MBC.⁣
⁣
بالإضافة إلى مشاركتها في مسلسل لبناني سعودي بعنوان «بعد حين»، بجانب استعدادها لتصوير مشاهدها من مسلسل سوري إماراتي سعودي بعد شهر من الآن.⁣
⁣
ومن المقرر أن تقوم النجمة السعودية بريفان بتصوير مشاهد مسلسلها بالتزامن مع تصوير فيلم خليجي؛ حيث تجري أعمال تصوير العملين في العاصمة الإماراتية «أبوظبي» حاليًا.⁣
⁣
وأشارت إلى أنها تعمل على التحضيرات لأعمالها الجديدة، والتي تختلف كل منهما عن الأخرى، والتي ستفاجئ جمهورها.⁣
⁣
